//index.js
var qcloud = require('../../vendor/wafer2-client-sdk/index')
var config = require('../../config')
var util = require('../../utils/util.js')
var ocr = require('../../utils/ocr.js')
var imgHelper = require('../../utils/img_helper.js')

var testImg = ''

var imgFile

Page({
    chooseImage: function(){
      var that = this
      wx.chooseImage({
        count: 1, // 9
        sizeType: ['original', 'compressed'], // 
        sourceType: ['album', 'camera'], // 
        success: function (res) {
          // tempFilePathimgsrc

          imgFile = res.tempFiles[0]
          that.setData({
            imgUrl: imgFile.path,
            bankInfo: false
          })
          
          console.log(imgFile.size / 1024 + 'kb')
          if (res.size > 1024 * 1024 * 3) {
            util.showModel('', ' 3M')
          } else {
            imgHelper.toBase64(imgFile, function (img) {
              that.ocrOption(img);
            })

          }
        }
      })
    },

    // ocr
    ocrOption: function (img) {
        util.showBusy("OCR...")
        var that = this
        var ret = ocr.getBankNumber({
          imgBase64:img,
          success: function(result){
            if (result){
              that.setData({
                bankInfo: result
              })
              util.showSuccess('');
            }else{
              util.showModel('', '')
            }
            
          },
          fail: function(){
            util.showModel('', '')
          },
          completed: function(){
            wx.hideToast()
          }
        })
    },

    //
    copyNumber: function(){
      var that = this
      wx.setClipboardData({
        data: that.data.bankInfo && that.data.bankInfo.bank_card_number ? that.data.bankInfo.bank_card_number : '',
        success: function (res) {
          wx.getClipboardData({
            success: function (res) {
              console.log(res.data) // data

              if(res.data)
                util.showSuccess('')
              else{
                util.showModel('','')
              }
            }
          })
        }
      })
    },

    // 
    previewImg: function () {
        wx.previewImage({
            current: this.data.imgUrl,
            urls: [this.data.imgUrl]
        })
    }

})
